function Movie({ key, coverImg, title, summary, genres }) {
    return (
        <div >
            <img src={coverImg} alt={title} />
            <h2>
                {title}
            </h2>
            <p>
                {summary ? summary : "undifined"}
            </p>
            <ul>
                {genres.map(g => <li key={g}>{g}</li>)}
            </ul>
            <hr />
        </div>
    )
}

export default Movie;
